pragma solidity ^0.8.7;
pragma experimental ABIEncoderV2;
import "./Wallet.sol";

contract Dex is Wallet {

    using SafeMath for uint256;
    enum Side {
        BUY,
        SELL
    }
    struct Order {
        uint id;
        address trader;
        Side side;
        bytes32 ticker;
        uint amount; 
        uint price;
    }
    uint public nextOrderID = 0;

    // maps a ticker to a mapping that maps to buy/sell order in the orderbook
    mapping(bytes32 => mapping(uint => Order[])) orderbook;

    function getOrderBook(bytes32 ticker, Side side) view public returns(Order[] memory) {
        return orderbook[ticker][uint(side)];
    }

    function createLimitOrder(Side _side, bytes32 _ticker, uint _amount, uint _price) public {

        if (_side == Side.BUY) {
            require(balances[msg.sender]["ETH"] >= _amount.mul(_price), "not enough Ether to place buy order");

            // create new buy order
            Order[] storage orders = orderbook[_ticker][0];
            orders.push(
                Order(nextOrderID, msg.sender, _side, _ticker, _amount, _price)
            );
            nextOrderID++;

            // sort buy orderbook in descending order
            uint i = orders.length > 0 ? orders.length - 1 : 0;
            while (i > 0) {
                if (orders[i].price >= orders[i - 1].price) {
                    Order memory temp = orders[i];
                    orders[i] = orders[i - 1];
                    orders[i - 1] = temp;
                }
                i--;
            }
        }

        if (_side == Side.SELL) {
            require(balances[msg.sender][_ticker] >= _amount.mul(_price), "not enough tokens to place sell order");

            // create new sell order
            Order[] storage orders = orderbook[_ticker][1];
            orders.push(
                Order(nextOrderID, msg.sender, _side, _ticker, _amount, _price)
            );
            nextOrderID++;

            // sort sell orderbook in ascending order
            uint i = orders.length > 0 ? orders.length - 1 : 0;
            while (i > 0) {
                if (orders[i].price <= orders[i - 1].price) {
                    Order memory temp = orders[i];
                    orders[i] = orders[i - 1];
                    orders[i - 1] = temp;
                }
                i--;
            }
        }

    }

}
